base_text:
Eight Songs for a Mad King is an avant-garde music theatre work composed by John Cage in 1947 for voice and chamber ensemble. The piece was created specifically for the German baritone singer, Maiko Kawakami, who had requested new works from Cage after hearing his previous compositions.

The title "Eight Songs for a Mad King" refers to the eight individual songs that make up the composition, each with its own unique character and style. The work is known for its experimental nature, incorporating unconventional techniques such as extended vocal techniques, chance operations, and prepared piano. These elements create an immersive experience for both performers and audience members, challenging traditional notions of music and performance.

